export const suggestions = suggestion => {
  if (suggestion === "artist") {
    return [
      {
        name: "Alican Akyüz"
      },
      {
        name: "Tolga Akyüz"
      },
      {
        name: "Mehmet Tansu Işıklı"
      }
    ];
  } else if (suggestion === "movement") {
    return [
      {
        name: "Expressionism"
      },
      {
        name: "Impressionism"
      },
      {
        name: "Dada"
      }
    ];
  } else if (suggestion === "century") {
    return [
      {
        name: "1800's"
      },
      {
        name: "1900's"
      },
      {
        name: "2000's"
      }
    ];
  } else if ((suggestion = "branch")) {
    return [
      {
        name: "Painting"
      },
      {
        name: "Sculpture"
      },
      {
        name: "Installation"
      }
    ];
  }
};
